string-array.item:
Hvis din lommelygte ikke virker, kan det skyldes følgende grunde:
- Lommelygten har stødt hele tiden, muligvis fordi strobe-tilstanden er tændt. Skridt til at slukke for strobe-tilstand: Tilbage til startsiden → Kontroller knappens position under [SOS, 0 ~ 10] → Træk knappen til under nummer 0;
- Åbnet anden lommelygte applikation eller kamera applikation på samme tid, luk disse app;
- Tillader ikke kamera tilladelse, lommelygten har brug for kamera tilladelse til at tænde lys. Trin til at tillade kamera tilladelse: Tilbage til startsiden → Klik på tænd / sluk-knappen → Tillad kamera tilladelser i pop op-vinduet;
- Denne lommelygts lommelygte er beskadiget. Du kan også bruge skærmen lys i stedet. Trin til brug af skærmlys: Tilbage til startsiden → Klik på skærmlysknappen i nederste højre hjørne.

Hvis dit kort ikke virker, skal du kontrollere følgende indstillinger:
- Du har ikke tilladt stedet tilladelse. Fremgangsmåde for at åbne placeringstilladelsen: Tilbage til startsiden → Klik på kompassen for at åbne kortet → Tillad tilladelse til stedet i vinduet med popup-programmets tilladelse;
- Brug kortet skal tænde for netværket, kontrollere, at det aktuelle netværk er normalt;
- Hvis der ikke er noget problem med ovenstående indstillinger, beklager jeg, din enhed understøtter ikke målretning, eller der er en abnormitet i positioneringen, og kortet kan ikke bruges normalt.
